import React from 'react';

function TreeCounter({ count }) {
  const count_css = {
    fontSize:'150px', fontWeight:'1000'
  }

  const x_css = {
    fontSize:'80px', fontWeight:'1000', display: 'block', margin:'20px'
  }
  return (
    <div className="tree-counter">
      <span style={count_css}>{count}</span>
      <span style={x_css}>Trees Planted</span>
    </div>
  );
}

export default TreeCounter;
